<script>
	import { onMount } from 'svelte';
	import { gsap } from 'gsap';

	let count = 0;
	let targetValue = 100;

	onMount(() => {
		const timeline = gsap.timeline();

		// Animate each path with a staggered delay
		timeline
			.set('#image', { opacity: 0, scale: 0.5 }) // Start at scale 0.5 and opacity 0
			.to('#image', { opacity: 1, scale: 1.03, duration: 1.2 }) // Scale up to 1.2
			.to('#image', { scale: 1, duration: 0.8 }); // Scale down to 1
		timeline.fromTo(
			'#product-black, #business-purple',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 150 }, duration: 2, ease: 'power1.out',  }, // Expand bar
			'<' // Align the bar animation with the number animation
		);
		timeline.fromTo(
			'#product-purple',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 50 }, duration: 5, ease: 'power1.out',  }, // Expand bar
			 // Align the bar animation with the number animation
		);
		timeline.fromTo(
			'#sales-black',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 200 }, duration: 5, ease: 'power1.out',  }, // Expand bar
			 // Align the bar animation with the number animation
		);
		timeline.fromTo(
			'#sales-purple, #creative-purple',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 100 }, duration: 8, ease: 'power1.out',  }, // Expand bar
			 // Align the bar animation with the number animation
		);
		timeline.fromTo(
			'#management-black',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 150 }, duration: 5, ease: 'power1.out',}, // Expand bar
			 // Align the bar animation with the number animation
		);
		timeline.fromTo(
			'#management-purple',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 50 }, duration: 8, ease: 'power1.out',  }, // Expand bar
			 // Align the bar animation with the number animation
		);
		timeline.fromTo(
			'#creative-black, #business-black',
			{ attr: { height: 0 }, rotation: -180, transformOrigin: 'center center ' }, // Start with bar collapsed
			{ attr: { height: 150 }, duration: 5, ease: 'power1.out' }, // Expand bar
			 // Align the bar animation with the number animation
		);
		timeline.to(
			{ val: count },
			{
				val: 100, // Target number
				duration: 3, // Animation duration in seconds
				roundProps: 'val', // Ensures no decimals
				onUpdate: function () {
					count = this.targets()[0].val; // Sync GSAP's value with `count`
				}
			},
			'<'
		);
	});
</script>

